// import axios from 'axios';
import { config } from '../config';

export default {

    Signup: (obj) => {
        console.log("data");
        return fetch(config.baseApiUrl + "/api/signup",obj).
        then((Response) => Response.json())
        .catch({ status: 500, message: 'Internal Server Error' });
    }
 }
